INSERT INTO `products` VALUES (123,'Blue Buffalo Life Protection Formula Adult Chicken & Brown Rice Recipe Dry Dog Food',49,'https://img.chewy.com/is/image/catalog/46861_MAIN._AC_SL1500_V1562596335_.jpg','Blue Buffalo Life Protection Formula was created for the holistic health and well-being of adult dogs. All formulas start with real meat, whole grains, garden veggies and fruit, plus added LifeSource Bits, a precise blend of nutrients that have been enhanced with a Super 7 package of antioxidant-rich ingredients. This Adult Chicken & Brown Rice Recipe features delicious, protein-rich deboned chicken and other natural ingredients for a healthy meal your dog will love.','2019-12-01 20:01:39','2019-12-01 20:01:39',6,7),(124,'Taste of the Wild High Prairie Grain-Free Dry Dog Food',49,'https://img.chewy.com/is/image/catalog/46861_MAIN._AC_SL1500_V1562596335_.jpg','Nourish your canine companion with the balanced diet nature intended with Taste of the Wild High Prairie Grain-Free Dry Dog Food! Formulated with novel proteins including buffalo and bison, this grain-free recipe includes peas and sweet potatoes that deliver the highly-digestible energy your active pup needs, along with natural antioxidant support from real fruits and vegetables and dried chicory root for prebiotic support and healthy digestion. Essential minerals are chelated with amino acids to optimize their absorption and ensure maximum benefit, for complete and balanced nutrition with a taste of the wild your furry friend constantly craves!','2019-12-01 20:01:39','2019-12-01 20:01:39',6,66),(125,'American Journey Salmon & Sweet Potato Recipe Grain-Free Dry Dog Food',40,'https://img.chewy.com/is/catalog/108423_MAIN._AC_SL1500_V1486751013_.jpg','American Journey is full of nutritious ingredients that fuel your pet’s everyday adventures. The Salmon & Sweet Potato Recipe Grain-Free Dry Dog Food formula features real, deboned salmon with the protein and amino acids your dog needs for leaner muscles, and the exceptional flavor she instinctively craves. Delicious sweet potatoes and chickpeas are included to give your pup energy that lasts. With wholesome fruits and veggies like carrots, dried kelp and blueberries, your dog is getting beneficial fiber, phytonutrients and antioxidants. Omega fatty acids are plentiful, including DHA, an omega-3 that supports healthy development of the brain and eyes. These omegas come from several sources like salmon oil and flaxseed, and they help keep your fellow adventurer’s skin and coat healthy. This recipe is grain-free and has no corn, wheat or soy, which makes it a great choice for dogs that are prone to food sensitivities.','2019-12-01 20:01:39','2019-12-01 20:01:39',6,3),(126,'Purina Pro Plan Focus Adult Sensitive Skin & Stomach Salmon & Rice Formula Dry Dog Food',48,'https://img.chewy.com/is/image/catalog/101143_MAIN._AC_SL1500_V1531940242_.jpg','Give your pet everything they need to thrive with Purina Pro Plan Focus Adult Sensitive Skin & Stomach Formula. It’s made with nutrient-rich salmon as the first ingredient for a protein-rich recipe your dog will crave and love. Plus, it has prebiotic fiber for sensitive stomach for a highly-digestible formula that nourishes the beneficial bacteria found in your dog\'s intestine. This special recipe includes ingredients, such as rice and oat meal to provide easily digestible sources of carbohydrates for your pal. Plus, it’s packed with fish oil—a source of omega 3 fatty acids—to help support healthy joints and mobility, and omega 6 fatty acids and zinc to nourish your dog\'s skin and keep his coat looking healthy. And best of all, it’s made without corn, wheat or soy.','2019-12-01 20:01:39','2019-12-01 20:01:39',6,55),(127,'Royal Canin German Shepherd Adult Dry Dog Food',66,'https://img.chewy.com/is/image/catalog/75164_MAIN._AC_SL1500_V1550511628_.jpg','This Royal Canin formula is designed exclusively for pure breed German Shepherds over 15 months. The German Shepherd has a notably fragile digestive system, which often leads to soft stools, frequent digestive upset and sometimes bloating. Unlike other breeds, the German Shepherd’s skin is extremely alkaline and very sensitive. That\'s why it\'s important to choose a diet tailor-made for their specific needs.','2019-12-01 20:01:39','2019-12-01 20:01:39',6,59),(128,'Blue Buffalo Carnivora Prairie Blend Grain-Free Adult Dry Dog Food',28,'https://img.chewy.com/is/image/catalog/167642_MAIN._AC_SL1500_V1565892754_.jpg','Give your friend a meal packed with protein straight from the meadow with Blue Buffalo Carnivora Prairie Blend Grain-Free Adult Dry Dog Food. It features a blend of farm-raised beef, beef liver, chicken, lamb and pork liver to make up 90% of the protein in this diet. This high-protein food contains nutrient-rich organs and cartilage to mimic what your pup would eat in nature. It also has vitamins and minerals to give your dog a complete and balanced diet with omega 3 and 6 fatty acids for skin and coat health. With no grains, peas or potatoes, Blue Buffalo Carnivora Prairie Blend Adult Dry Dog Food has the protein and nutrients to keep your companion going strong.','2019-12-01 20:01:39','2019-12-01 20:01:39',6,7),(129,'Hill\'s Science Diet Adult Sensitive Stomach & Skin Chicken Recipe Dry Dog Food',58,'https://img.chewy.com/is/image/catalog/48856_MAIN._AC_SL1500_V1547654516_.jpg','Hill\'s Science Diet Adult Sensitive Stomach & Skin Dry Dog Food provides your pup with precise nutrition for a healthy lifestyle. Made with wholesome ingredients such as savory chicken meal and barley, this nourishing recipe is balanced to meet your pet’s needs and nourish the skin and coat. Manufactured in the United States, every ingredient meets strict requirements for purity and nutrient content which exceed industry standards. Formulated for adult dogs with sensitive stomachs, this Hill’s Science Diet provides your pooch with the nutrition he needs for a lifetime of health and happiness.','2019-12-01 20:01:39','2019-12-01 20:01:39',6,28),(130,'Iams ProActive Health Adult Large Breed Dry Dog Food',32,'https://img.chewy.com/is/image/catalog/62299_MAIN._AC_SL1500_V1569541641_.jpg','Designed for dogs over a year old and over 50 pounds, Iams ProActive Health is specially formulated to help maintain your large dog\'s joints healthy. Protein sourced from chicken and egg helps build strong, firm muscles while seven essential nutrients nourish the heart. Antioxidants help maintain a strong immune system. Crunchy kibbles scrub your dog\'s teeth with every bite to help reduce plaque and tartar build-up that can lead to bad breath.','2019-12-01 20:01:39','2019-12-01 20:01:39',6,31),(131,'Rachael Ray Nutrish Natural Beef, Pea, & Brown Rice Recipe Dry Dog Food',37,'https://img.chewy.com/is/image/catalog/122312_MAIN._AC_SL1500_V1536607670_.jpg','Give your pooch simple, natural ingredients with the Rachael Ray Nutrish Natural Beef, Peas & Brown Rice Recipe Dry Dog Food. Starting with U.S. farm-raised beef as the first ingredient, this recipe is also packed with wholesome veggies like peas and carrots, plus whole fiber as an excellent carbohydrate source. Added vitamins and minerals round out the complete and balanced nutrition, and there’s even natural prebiotics included to support a healthy digestion. And it’s all made right in the USA, with no artificial flavors or preservatives.','2019-12-01 20:01:39','2019-12-01 20:01:39',6,56),(132,'True Acre Foods Beef & Vegetable Recipe Grain-Free Dry Dog Food',40,'https://img.chewy.com/is/image/catalog/150194_Main._AC_SL1500_V1551302462_.jpg','Bring some grain-free goodness to your pup’s bowl. True Acre Foods Beef & Vegetable Recipe is made with USA-raised beef as the first ingredient and real, farm-grown veggies like peas and carrots. This complete and balanced kibble delivers flavor and nutrition to delight and nourish your dog with every bite. It’s crafted with natural fibers to support gentle digestion, antioxidants to support a strong immune system, and omega-3 and 6 fatty acids to help maintain a healthy and shiny skin and coat. Plus, there are no grains like wheat or corn, or artificial colors or flavors.','2019-12-01 20:01:40','2019-12-01 20:01:40',6,73),(133,'VICTOR Hero Grain-Free Dry Dog Food',54,'https://img.chewy.com/is/image/catalog/93076_MAIN._AC_SL1500_V1560367071_.jpg','Provide your active pup with the nutrition they need with VICTOR Purpose Grain Free Hero Canine Dry Dog Food. This multi-protein, nutrient-dense recipe is formulated for dogs with allergies to certain proteins or grains. It is made with premium-quality beef, pork and fish meals and ideal for highly active adult dogs that are susceptible to joint issues later in life. This diet also has glucosamine and chondroitin for long-term joint health. Keep your furry friend going strong with Victor Purpose Grain Free Hero Canine Dry Dog Food.','2019-12-01 20:01:40','2019-12-01 20:01:40',6,76),(134,'Evolve Deboned Beef, Barley & Brown Rice Recipe Dry Dog Food',39,'https://img.chewy.com/is/image/catalog/79874_MAIN._AC_SL1500_V1541538140_.jpg','Feed your furry best friend the balanced nutrition of Evolve Deboned Beef, Barley & Brown Rice Recipe Dry Dog Food. Made with high-quality, deboned beef as the first ingredient to help build lean muscles, along with complex carbohydrates such as barley and brown rice to deliver sustained energy, beets for a healthy digestion, as well as flaxseed and eggs, which are naturally rich in omega-3 fatty acids to help promote healthy skin and a shiny coat. This classic meal is also filled with essential vitamins and minerals from vegetables and fruits, such as carrots, cranberries and blueberries for your pal’s overall health and well-being. It’s enhanced with prebiotics and probiotics for digestion. Plus, it does not contain corn, soy, wheat or artificial additives, so you can feel confident that you’re feeding a superior natural food with a delicious flavor to your furry pal.','2019-12-01 20:01:40','2019-12-01 20:01:40',6,16),(135,'Triumph Beef, Barley & Carrot Recipe Dry Dog Food',34,'https://img.chewy.com/is/image/catalog/79659_MAIN._AC_SL1500_V1512769101_.jpg','Triumph dry dog food recipes were developed to fulfill the promise of complete nutrition from natural formulations. Healthy, wholesome ingredients, natural flavors, natural colors and natural preservatives are the hallmarks of these superior recipes.','2019-12-01 20:01:40','2019-12-01 20:01:40',6,71),(136,'VICTOR Multi-Pro Dry Dog Food',31,'https://img.chewy.com/is/image/catalog/101783_MAIN._AC_SL1500_V1554473545_.jpg','Keep your pup going strong with VICTOR Classic Multi-Pro Dry Dog Food. This diet is made with premium-quality beef, chicken and pork meals for normally active dogs, regular maintenance and off-season periods of lower activity. It is also fortified with vitamins, minerals, essential fatty acids, protein and amino acids. Made with gluten-free grains, Victor Classic Multi-Pro Dry Dog Food is a complete and balanced diet for your furry friend.','2019-12-01 20:01:40','2019-12-01 20:01:40',6,76),(137,'Natural Balance L.I.D. Limited Ingredient Diets Sweet Potato & Fish Formula Grain-Free Dry Dog Food',60,'https://img.chewy.com/is/image/catalog/76787_MAIN._AC_SL1500_V1527709631_.jpg','Huckleberry Hound lost his tackle box? Not a problem. Dick Van Patten\'s Natural Balance L.I.D. Limited Ingredient Diets Sweet Potato & Fish Dry Dog Food brings the fishies to him. Best of all, it\'s a grain-free formula that is proven nutrition suitable for dogs with sensitive tummies or food-related allergies. Salmon is an easily-digested protein not normally found in common dog foods, reducing the risk of inherited allergic reactions, and fresh sweet potatoes provide premium carbohydrates and potassium.','2019-12-01 20:01:40','2019-12-01 20:01:40',6,45),(138,'Wellness CORE Grain-Free Ocean Whitefish, Herring & Salmon Recipe Dry Dog Food',60,'https://img.chewy.com/is/image/catalog/49158_MAIN._AC_SL1500_V1555091875_.jpg','Nourish your canine companion’s primal essence with the protein-rich nutrition of Wellness CORE Grain-Free Ocean Whitefish, Herring & Salmon Recipe Dry Dog Food. With real whitefish as the first ingredient along with herring, salmon and menhaden fish meals, this nutrient-dense, grain-free recipe contains all the protein needed to help your adult dog maintain lean, powerful muscles. It’s fortified with antioxidants, omega fatty acids, glucosamine and probiotics to make sure his immune system, skin and coat, joints and gastrointestinal systems stay healthy and strong throughout his long, active life. You can be sure your furry friend is getting everything he needs to thrive from the core with this premium-quality diet that contains no wheat, fillers, or artificial ingredients.','2019-12-01 20:01:40','2019-12-01 20:01:40',6,77),(139,'Hill\'s Prescription Diet i/d Digestive Care Low Fat Original Flavor Pate Canned Dog Food, 13-oz, case of 12',38,'https://img.chewy.com/is/catalog/69765_MAIN._AC_SL1500_V1468878678_.jpg','Inappropriate levels of fat in the blood, inability to digest protein, or lack of digestive enzymes can affect your dog\'s digestive health. Efficient digestion is essential for your dog to be able to build and repair tissues and obtain energy, and for these reasons it is important to feed a food that is formulated to help support digestive health. For many dogs experiencing digestive challenges, it\'s also very important to feed a food with a low fat level. At Hill\'s, nutritionists and veterinarians have developed clinical nutrition especially formulated to help manage dogs with challenging digestive health problems.','2019-12-01 20:01:40','2019-12-01 20:01:40',6,28),(140,'Pedigree Chopped Ground Dinner Combo With Chicken, Beef & Liver Canned Dog Food, 22-oz, case of 12',9,'https://img.chewy.com/is/image/catalog/114326_MAIN._AC_SL1500_V1539294265_.jpg','Give your best buddy a hearty meal with the Pedigree Chopped Ground Dinner Combo With Chicken, Beef & Liver Canned Dog Food. Made with a ground texture that will make his mouth water, this meaty feast contains optimal levels of oils and minerals to promote healthy skin and a glistening coat. The balanced recipe is also highly digestible, which means your dog can easily absorb all those essential nutrients—so you can feel confident that he’s getting the most out of every meal. But all he’ll really care about is the irresistible flavor, which is sure to get a tail wag at every mealtime.','2019-12-01 20:01:40','2019-12-01 20:01:40',6,48),(141,'Stella & Chewy\'s Chewy\'s Chicken Dinner Patties Freeze-Dried Raw Dog Food',50,'https://img.chewy.com/is/image/catalog/93475_MAIN._AC_SL1500_V1528828394_.jpg','Give your dog what he naturally craves with Stella & Chewy\'s Chewy\'s Chicken Dinner Patties Freeze-Dried Raw Dog Food. Based on the philosophy that dogs thrive on the same diet they would eat in the wild, this all-natural recipe makes it easy to feed your best friend only the good stuff. Made from sustainably-sourced ingredients and raw, single-source protein, this recipe starts with 95% cage-free chicken, organs and bone, plus 100% certified-organic fruits and vegetables—offering the benefits of raw food nutrition with the convenience of freeze-dried preparation. And to ensure the highest quality, each batch is made with care in Stella & Chewy’s own U.S.-kitchen.','2019-12-01 20:01:40','2019-12-01 20:01:40',6,65),(142,'Milk-Bone Soft & Chewy Beef & Filet Mignon Recipe Dog Treats',8,'https://img.chewy.com/is/catalog/99876_MAIN._AC_SL1500_V1462917216_.jpg','Milk-Bone Soft & Chewy Beef & Filet Mignon Recipe Dog Treats are savory, tender treats made with real beef and filet mignon infused with a natural smoke flavor. Their gourmet meaty taste is sure to spark pure joy in your pup as soon as he hears the crinkle of the bag and smells the delicious aroma of premium beef. With their pliable texture, these bone-shaped snacks are easier to chew and make the perfect reward for dogs with tender gums, senior dogs or any dog that prefers a softer treat. You can feel good about giving your pup such a decadent treat because it’s fortified with 12 vitamins and minerals to help keep dogs at their best.','2019-12-01 20:01:40','2019-12-01 20:01:40',7,40),(143,'Greenies Pill Pockets Canine Chicken Flavor Dog Treats',15,'https://img.chewy.com/is/image/catalog/73571_MAIN._AC_SL1500_V1551195242_.jpg','Turn medication time into treat time with Greenies Pill Pockets Canine Chicken Flavor Dog Treats. Each savory pouch is designed to easily conceal the smell and taste of most pills and help make it easier for your pooch to get the treatment she needs to feel better. These all-natural treats are designed by veterinarians and come in both a capsule-compatible size and a tablet-compatible size! Plus, they\'re made with real chicken first for the high-quality protein your dog needs and the flavor she craves. With Greenies pill pockets, giving your canine companion her medicine can now be a positive, rewarding experience for you both. Simply place the pill in the pocket, pinch it closed and feed it to your BFF!','2019-12-01 20:01:40','2019-12-01 20:01:40',7,9),(144,'Hill\'s Natural Soft Savories with Peanut Butter & Banana Dog Treats, 8-oz bag',4,'https://img.chewy.com/is/image/catalog/83147_MAIN._AC_SL1500_V1563889100_.jpg','Hill\'s Natural Soft Savories with Peanut Butter & Banana Dog Treats prove that tasty treats can be healthy too. Based on the idea that daily nutrition is the most important thing that you can do for your dog, these natural treats are made only from the best ingredients, with zero artificial flavors or preservatives. Real peanut butter is the number one ingredient, and the soft, tender texture will delight your deserving dog—because we all need a little snack now and then, so why not make it nutritious and delicious too?','2019-12-01 20:01:40','2019-12-01 20:01:40',7,28),(145,'Pup-Peroni Original Beef Flavor Dog Treats',12,'https://img.chewy.com/is/image/catalog/125211_MAIN._AC_SL1500_V1495210542_.jpg','For more beef flavor and an aroma that’ll make your doggy drool, only Pup-Peroni Original Beef Flavor Dog Treats will do. You can’t fool your dog when it comes to meat, and he surely won’t mistake the smoky natural scent of beef–the very first ingredient in these tasty treats. They’re slow-cooked to capture the appetizing flavor of real beef simmered in its own savory juices. These chewy sticks make the perfect reward for your best friend whether you’re on the road, out for a hike or just finishing up a fun fetch session. They also make an ideal training treat when broken into smaller pieces.','2019-12-01 20:01:40','2019-12-01 20:01:40',7,53),(146,'American Journey Beef Recipe Grain-Free Soft & Chewy Training Bits Dog Treats, 4-oz bag',3,'https://img.chewy.com/is/image/catalog/151164_MAIN._AC_SL1500_V1553179674_.jpg','Reward your sidekick with a chewy, tasty treat that’s just the right size for training. American Journey Soft & Chewy Training Bits are moist, soft bites that are crafted with real beef as the first ingredient for the taste dogs crave. At only 4 calories per treat, they’re perfect for all your training sessions, or as a portable, protein-rich snack for the road or trail. And if you’re wondering what else goes into these delicious treats besides real protein, you can feel good knowing it’s easily digestible, wholesome ingredients like peas, sweet potatoes and chickpeas. Plus, they’re a source of omega fatty acids from flaxseed and salmon oil, to support a healthy skin and coat.','2019-12-01 20:01:40','2019-12-01 20:01:40',7,3),(147,'Merrick Power Bites Real Texas Beef Recipe Grain-Free Soft & Chewy Dog Treats, 6-oz bag',6,'https://img.chewy.com/is/image/catalog/77100_MAIN._AC_SL1500_V1508790171_.jpg','Merrick Power Bites are all-natural, soft and chewy treats with big taste and industry-leading levels of protein packed into every bite. They start with real deboned meat as the #1 ingredient, with added nutrition from fresh fruits and vegetables. Perfect for rewarding or training, your dog is sure to love Power Bites!','2019-12-01 20:01:40','2019-12-01 20:01:40',7,37),(148,'Wellness Soft Puppy Bites Grain-Free Lamb & Salmon Recipe Dog Treats, 3-oz',4,'https://img.chewy.com/is/catalog/49229_MAIN._AC_SL1500_V1465915866_.jpg','Wellness Soft Puppy Bites Grain-Free Lamb & Salmon Recipe Dog Treats are wholesome, all natural, tasty, bite-sized dog treats. Made in the USA and specially formulated for puppies under 1 year your pup will be eating nothing but the best! A mixture of pure meat protein with added fruits and veggies gives your growing dog the nutrients to be healthy and strong. You can feel good about training and rewarding your pup with Wellness natural dog treats.','2019-12-01 20:01:40','2019-12-01 20:01:40',7,77),(149,'Beggin\' Strips Bacon & Beef Flavor Dog Treats',10,'https://img.chewy.com/is/image/catalog/92057_MAIN._AC_SL1500_V1569949959_.jpg','Beggin\' Strips Bacon & Beef Flavor Dog Treats bring out uncontainable excitement in dogs. Made with real bacon, these mouthwatering treats begin with a smoky, sizzling scent and a savory flavor that’s enhanced by the addition of beef for a double dose of meaty tastiness that dogs love. Soft, chewy, delicious and easy to break apart, Beggin’ Strips provide a fun training treat for dogs of all sizes.','2019-12-01 20:01:40','2019-12-01 20:01:40',7,5),(150,'Blue Buffalo Blue Bits Tender Beef Recipe Soft-Moist Training Dog Treats',4,'https://img.chewy.com/is/image/catalog/64612_MAIN._AC_SL1500_V1558106524_.jpg','Your pal will give you his undivided attention with the Blue Buffalo Blue Bits Tender Beef Recipe Soft-Moist Training Dog Treats. Designed to make training that much more enticing, these moist, bite-sized treats are made with protein-rich, USA beef as the first ingredient for a dose of meaty goodness in every irresistible morsel. They’re also loaded with DHA from salmon oil to support healthy cognitive development in growing puppies, and omega-3 and 6 fatty acids to promote a healthy skin and coat. Plus, they’re free of any chicken or poultry by-product meals, wheat, soy, corn, or anything artificial so you can feel good about treating your pal every day.','2019-12-01 20:01:40','2019-12-01 20:01:40',7,7),(151,'Milo\'s Kitchen Chicken Meatballs Dog Treats',13,'https://img.chewy.com/is/image/catalog/100018_MAIN._AC_SL1500_V1510778286_.jpg','The best treats come right from the kitchen, and Milo\'s Kitchen Chicken Meatballs Dog Treats are proof. These mouthwatering meatball treats have a soft texture and savory taste, and they’re made with real chicken as the #1 ingredient. They don’t just look like meatballs, but they actually are meatballs, which makes them worthy of hiding in a safe spot for later and even better for eating right on the spot. They’re deliciously wholesome snacks with an authentic, natural chicken flavor. Show them the love with a treat that’s cooked to perfection and has no artificial flavors or colors—just home-style goodness.','2019-12-01 20:01:40','2019-12-01 20:01:40',7,41),(152,'SmartBones SmartSticks Peanut Butter Chews Dog Treats',5,'https://img.chewy.com/is/catalog/68229_MAIN._AC_SL1500_V1460478783_.jpg','Many veterinarians are concerned with the potential health risks associated with dogs consuming rawhide. Rawhide-free SmartSticks chews made with real chicken, vegetables and other healthy ingredients dogs love provide your canine companion with needed chewing exercise and great taste. These chew treats are the healthier alternative to regular rawhide treats which may cause intestinal blockages. SmartBones are 99.2% digestible, which is higher than the digestibility of premium dog foods (85% digestibility). Smart chews for smart dogs!','2019-12-01 20:01:40','2019-12-01 20:01:40',7,63),(153,'Good \'n\' Fun Triple Flavor Kabobs Chicken, Duck & Chicken Liver Dog Chews, 18 count',8,'https://img.chewy.com/is/catalog/102212_MAIN._AC_SL1500_V1479227192_.jpg','Good \'n\' Fun has created the ultimate rawhide treat with their Triple Flavor Kabobs Chicken, Duck & Chicken Liver Dog Chews. These gourmet kabobs are made with premium pork and beef hides wrapped with delicious cuts of real chicken breast, savory duck and hearty chicken liver. It’s no wonder these chews are preferred 18 to 1 over other combination chews in doggy taste tests. Good ‘n’ Fun provides long-lasting entertainment and a healthy way to satisfy your dog’s natural chewing urges.','2019-12-01 20:01:40','2019-12-01 20:01:40',7,26),(154,'American Journey Peanut Butter Recipe Grain-Free Oven Baked Crunchy Biscuit Dog Treats',3,'https://img.chewy.com/is/image/catalog/125861_MAIN._AC_SL1500_V1510676297_.jpg','American Journey Peanut Butter Recipe Grain-Free Oven Baked Crunchy Biscuit Dog Treats are grain-free, crunchy snacks sure to please your pup whether you’re both on the go or right at home. Small but full of flavor, these bite-size treats are made with wholesome ingredients that will keep your pup energized for any daily adventure ahead. Every bite is packed with the crispy crunch that could only come from a treat that’s perfectly baked right in the oven! Real peanut butter is baked right with wholesome peas and chickpeas. And these naturally preserved, filler-free treats are also free of poultry by-product meal and artificial colors, flavors and preservatives. Treat your dog to quality and taste with American Journey Grain-Free Oven Baked Treats. Available exclusively at Chewy.com.','2019-12-01 20:01:40','2019-12-01 20:01:40',7,3),(155,'USA Bones & Chews Roasted Marrow Bone 6\" Dog Treat\"',4,'https://img.chewy.com/is/image/catalog/86899_MAIN._AC_SL1500_V1512484676_.jpg','Roasted Marrow Bone is full of flavors sure to satisfy your dog’s natural palate. These 100% natural USA beef bones are slow-roasted to preserve the tasty, natural meat flavor. These high density bones are filled with natural marrow to ensure a long lasting challenge for your active chewer. Never contains added artificial colors, flavors or preservatives.','2019-12-01 20:01:40','2019-12-01 20:01:40',7,74),(156,'Blue Buffalo Blue Bits Tasty Chicken Recipe Soft-Moist Training Dog Treats',4,'https://img.chewy.com/is/image/catalog/46937_MAIN._AC_SL1500_V1558106547_.jpg','Blue Buffalo Blue Bits Tasty Chicken Recipe Soft-Moist Training Dog Treats are natural dog treats that are optimally-sized for repeat rewards. Perfect for training and treating your furry friend, Blue Bits are a healthy and nutritious reward that your pup will love. Each meaty morsel is loaded with high-quality chicken for protein and contains no by-product meals. Added DHA for cognitive support and omega 3 and 6 fatty acids for skin and coat health make this a healthy treat you can feel good about giving your dog.','2019-12-01 20:01:40','2019-12-01 20:01:40',7,7),(157,'Milk-Bone Good Morning Healthy Joints Daily Vitamin Dog Treats',9,'https://img.chewy.com/is/catalog/99850_MAIN._AC_SL1500_V1462917182_.jpg','Instead of giving your devoted pup a vitamin each morning, you can give him Milk Bone’s tasty, nutrient-rich Good Morning Healthy Joints Daily Vitamin Dog Treats to start him off on the right paw. Pets that experience stiff joints that impact their mobility can benefit from this special dose of select nutrients, including glucosamine and chondroitin. The health-promoting ingredients in this treat target the joints specifically but also work throughout the entire body to support your dog’s well-being and longevity in many different ways. His immune system will benefit from vitamin C and antioxidants, and fiber is included for smoother digestive processes. Omega-3 helps nourish his well-worn coat, and even brain health is supported by DHA. These chewy bones are made for dogs of all sizes—the amount of treats you give depends on the size of your dog.','2019-12-01 20:01:40','2019-12-01 20:01:40',7,40),(158,'USA Bones & Chews Beef Foreshank Bone Dog Treat',6,'