and conflict in multi-cat households.','2019-12-01 20:01:40','2019-12-01 20:01:40',5,18),(232,'Rescue Remedy Stress Relief Pet Supplement',5,'https://img.chewy.com/is/image/catalog/108097_MAIN._AC_SL1500_V1561737717_.jpg','Rescue Remedy Stress Relief Pet Supplement is well-known by pet parents for safe, natural stress relief. This homeopathic solution is alcohol-free and recommended by veterinarians for calming your cat or dog during stressful situations. It’s a must-have for animals that are afraid of everyday things like thunderstorms, fireworks, going to the vet or being groomed. Rescue Remedy also helps pets after they’ve experienced a distressing event, such as separation anxiety, moving or getting lost. It’s made from a combination of five flower remedies, including Star of Bethlehem, Rock Rose, Cherry Plum, Impatiens and Clematis. It’s easy to administer—just use the dropper to add a few drops to your pet’s water bowl.','2019-12-01 20:01:40','2019-12-01 20:01:40',5,58),(233,'Pet Naturals of Vermont Calming Cat Chews, 30 count',7,'https://img.chewy.com/is/catalog/91124_MAIN._AC_SL1500_V1474979067_.jpg','Put the cool back in your kitty. Pet Naturals\' Calming has high potency, natural ingredients that are properly formulated for optimal results. It’s the natural, delicious, chicken liver flavored way to get the crazy out of your kitty. When pets can’t adapt to stress it can lead to nervousness, hyperactivity, abnormal urine marking, excessive scratching, and destructive or aggressive behavior. Calming helps alleviate stress related behavior problems without affecting your animal’s personality or energy level.','2019-12-01 20:01:40','2019-12-01 20:01:40',5,50),(234,'Frisco Holiday Llama Dog & Cat Cozy Fleece PJs',13,'https://img.chewy.com/is/catalog/91124_MAIN._AC_SL1500_V1474979067_.jpg','There’s a whole llama holiday cheer going around! Made with 100% polyester fleece, they help keep your pal warm and comfy—not to mention holiday-ready. They’re soft and comfor